const nominator = (nominees = new Map(), action) => {
    switch (action.type) {
        case 'NOMINATE':
            nominees.set(action.payload.imdbID, action.payload.data);
            return nominees;

        case 'REMOVE':
            nominees.delete(action.payload.imdbID);
            return nominees;
    }
}

export default nominator;
